import React from "react";
import "../styles/About.css";

const About = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <p>
        Welcome to FishNow! We are dedicated to providing the best experience
        for fishing enthusiasts. Our platform allows users to explore various
        lakes, learn more about fishing spots, and stay updated on fishing tips
        and events.
      </p>
      <p>
        Our mission is to connect fishermen with the resources they need to
        enjoy their passion. Whether you're a seasoned pro or just starting,
        FishNow is your go-to resource for all things fishing.
      </p>
      <h2>Our Team</h2>
      <p>
        Our team consists of passionate fishermen, developers, and designers who
        are committed to making FishNow the best place for the fishing
        community. We're always working on new features and improvements to
        ensure a seamless experience for you.
      </p>
    </div>
  );
};

export default About;
